@gscacco @nu_shell Here's what I came up with (though there may be better solutions):

alias subtract-offset [list] { echo $list | each -n { = $it.item - $(echo $list | nth $(if $it.index &gt; 0 { echo $(= $it.index - 1) } { = 0 }))}}

subtract-offset [1 2 13]

