@victorkoenders @rustlang One trick I've done to help is to add methods to u32 via a trait.  This lets you extract bits like this:

let msb = bits.get_msb();

You can also use methods for masks, or set up constants. Eg (from @ferristweetsnow) https://t.co/psT9ulWJLp

